class APIError extends ExtendableError {
  constructor (statusCode, error) {
    super(error.message)
    this.statusCode = error.statusCode
    this.code = error.code
    this.stackApi = null
    this.stackApi = error.stack
  }

  toString () {
    return `${super.toString()}\nStatusCode: ${this.statusCode}\nApiStack: ${this.stackApi}\nStack: ${this.stack}`
  }
}

export class RequestError extends APIError { }
export class ServerError extends APIError { }

import ParamBuilder from './paramBuilder'
import URI from 'urijs'

export default class FilterBuilder {
  constructor () {
    this._param = new ParamBuilder(this)
    this.reset()
  }

  reset () {
    this._where = {}
    this._include = null
    this._fields = null
    this._limit = null
    this._order = null
    this._skip = null
    this._deleted = null
  }

  /**
   * Where query filter
   * Accepts operators, see [Where operators](http://docs.spaceinvoices.com/?shell#where-operators) section for details.
   * @param {*} fields
   */
  where (...fields) {
    fields.forEach(field => {
      this._where[field] = null
    })
    return this._param
  }

  /**
   * Logical AND operator
   * @param {string} fields
   */
  and (...fields) {
    this._operator('and', fields)
    return this._param
  }

  /**
   * Logical OR operator
   * @param {string} fields
   */
  or (...fields) {
    this._operator('or', fields)
    return this._param
  }

  _operator (operation, fields) {
    if (this._where[operation] === undefined) {
      let tmpWhere = Object.assign({}, this._where)
      this._where = {}
      this._where[operation] = [tmpWhere]
    }
    fields.forEach(field => {
      let tmpWhere = {}
      tmpWhere[field] = null
      this._where[operation].push(tmpWhere)
    })
  }

  /**
   * Used to include related models
   * @param {*} model
   */
  include (model) {
    this._include = model
    return this
  }

  /**
   * Include or exclude certain fields
   * @param {*} fields
   */
  fields (...fields) {
    this._fields = {}
    fields.forEach(field => {
      this._fields[field] = true
    })
    return this
  }

  /**
   * Limit amount of data returned
   * @param {number} limit
   */
  limit (limit) {
    this._limit = limit
    return this
  }

  /**
   * Order results by property
   * @param {string} field
   * @param {string} sort ASC or DESC
   */
  order (field, sort = 'ASC') {
    this._order = { field, sort }
    return this
  }

  /**
   * Number of results to skip
   * @param {number} skip
   */
  skip (skip) {
    this._skip = skip
    return this
  }

  /**
   * Also return deleted records. Only available on models that implement soft delete
   */
  deleted () {
    this._deleted = true
    return this
  }

  buildObject () {
    let filter = {}
    if (this._where) {
      filter.where = this._where
    }
    if (this._include) {
      filter.include = this._include
    }
    if (this._fields) {
      filter.fields = this._fields
    }
    if (this._limit) {
      filter.limit = this._limit
    }
    if (this._order) {
      filter.order = this._order
    }
    if (this._skip) {
      filter.skip = this._skip
    }
    if (this._deleted) {
      filter.deleted = this._deleted
    }

    return filter
  }

  buildUri (endpoint = '', decode = false) {
    let filter = { filter: this.buildObject() }

    let filterFlatten = this._flattenFilter(filter)
    let uriFilter = URI.buildQuery(filterFlatten)
    let uri = URI(endpoint + (URI(endpoint).search() ? '&' : '?') + uriFilter)

    if (decode) {
      return URI.decode(uri.toString())
    } else {
      return uri.toString()
    }
  }

  _flattenFilter (ob, lvl = 0) {
    let toReturn = {}
    for (let i in ob) {
      if (!ob.hasOwnProperty(i)) continue

      if ((typeof ob[i]) === 'object') {
        let flatObject = this._flattenFilter(ob[i], ++lvl)
        for (let x in flatObject) {
          if (!flatObject.hasOwnProperty(x)) continue

          if (lvl !== 1) {
            toReturn[`[${i}]${x}`] = flatObject[x]
          } else {
            toReturn[`${i}${x}`] = flatObject[x]
          }
        }
      } else {
        toReturn[`[${i}]`] = ob[i]
      }
    }
    return toReturn
  }
}

import FilterBuilder from './filterBuilder' // eslint-disable-line no-unused-vars

export default class ParamBuilder {
  /**
   *
   * @param {FilterBuilder} filter
   */
  constructor (filter) {
    this._filter = filter
  }

  /**
   * Equivalence
   * @param {*} value
   *
   * @returns {FilterBuilder}
   */
  eq (value) {
    this._setValue(value)
    return this._filter
  }

  /**
   * Not equal (!=)
   * @param {*} value
   */
  neq (value) {
    this._setValue({ neq: value })
    return this._filter
  }

  /**
   * Numerical greather than (>)
   * Valid for numberical and date values. For Geopoint values, the units are in miles by default.
   *
   * @param {string|number|Date} value
   */
  gt (value) {
    this._setValue({ gt: value })
    return this._filter
  }

  /**
   * Numerical greater than of equal (>=)
   * Valid for numberical and date values. For Geopoint values, the units are in miles by default.
   *
   * @param {string|number|Date} value
   */
  gte (value) {
    this._setValue({ gte: value })
    return this._filter
  }

  /**
   * Numerical less than (<)
   * Valid only for numerical and date values. For Geopoint values, the units are in miles by default.
   * @param {string|number|Date} value
   */
  lt (value) {
    this._setValue({ lt: value })
    return this._filter
  }

  /**
   * Numerical less than or equal (<=)
   * Valid only for numerical and date values. For Geopoint values, the units are in miles by default.
   * @param {string|number|Date} value
   */
  lte (value) {
    this._setValue({ lte: value })
    return this._filter
  }

  /**
   * True if the value is between the two specified values
   * greater than or equal to first value and less than or equal to second value.
   * @param {*} valFrom
   * @param {*} valTo
   */
  between (valFrom, valTo) {
    this._setValue({ between: [valFrom, valTo] })
    return this._filter
  }

  /**
   * In an array of values.
   * @param {*} values
   */
  inq (...values) {
    this._setValue({ inq: values })
    return this._filter
  }

  /**
   * Not in an array of values.
   * @param {*} values
   */
  nin (...values) {
    this._setValue({ nin: values })
    return this._filter
  }

  /**
   * For geolocations, return the closest points, sorted in order of distance.
   * Use with limit to return the n closest points.
   * maxDistance and unit can also be passed on same level as near to configure the search.
   * @param {string} near
   * @param {number} maxDistance
   * @param {string} unit miles or meters. Default: miles
   */
  near (near, maxDistance = null, unit = null) {
    let value = near
    if (maxDistance) {
      value = Object.assign({}, { near, maxDistance })
    }
    if (unit) {
      value = Object.assign({}, { near, maxDistance, unit })
    }
    this._setValue(value)
    return this._filter
  }

  /**
   * LIKE operators for use with regular expressions
   * @param {string} value
   */
  like (value) {
    this._setValue({like: value})
    return this._filter
  }

  /**
   * NOT LIKE operators for use with regular expressions
   * @param {string} value
   */
  nlike (value) {
    this._setValue({nlike: value})
    return this._filter
  }

  /**
   * Regular expression
   * @param {string} regexp
   */
  regexp (regexp) {
    this._setValue({ regexp })
    return this._filter
  }

  /**
   * Sets the value to the filter builder
   * @param {*} value
   */
  _setValue (value) {
    let fields = this._filter._where

    if (this._filter._where.and !== undefined) {
      fields = this._filter._where.and[this._filter._where.and.length - 1]
    } else if (this._filter._where.or !== undefined) {
      fields = this._filter._where.or[this._filter._where.or.length - 1]
    }

    for (var key of Object.keys(fields)) {
      fields[key] = value
    }
  }
}

import { RequestError, ServerError } from '../services/errors'
